import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
     <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          Strix
        </Typography>
        <Button component={Link} to='/' color="inherit">Home</Button>
        <Button component={Link} to='Products' color="inherit">Products</Button>
        <Button component={Link} to='/About' color="inherit">About</Button>
        <Button component={Link} to='/Feedback' color="inherit">Feedback</Button>
        <Button component={Link} to='/Sign In' variant="contained" color="secondary">Sign In</Button>
      </Toolbar>
     </AppBar>
  );
};

export default Navbar;
